import React from 'react'
import { Link } from "react-router-dom";


export default function Header() {
    return (
      <div>
        <ul>
          <li>
            <Link to="/">home</Link>
          </li>
          <li>
            <Link to="/about">about</Link>
          </li>
          <li>
            <Link to="/cards">cards</Link>
          </li>
        </ul>
      </div>
    );
}
